import React, { useState, useEffect } from 'react';
import { get } from '@vercel/edge-config';

const fetchEdgeConfigValue = async (key) => {
  console.log(`Fetching config for ${key}...`);
  try {
    const value = await get(key);
    console.log('Config value fetched:', value);  // Log the response to check the value
    return value;
  } catch (error) {
    console.log('Error fetching config:', error); // Log any error that might occur
  }
};

const ConfigDisplay = () => {
  const [configValue, setConfigValue] = useState(null);

  useEffect(() => {
    const getConfig = async () => {
      const value = await fetchEdgeConfigValue('db_connection_string');
      setConfigValue(value); // Update the state with fetched value
    };

    getConfig(); // Trigger the fetch
  }, []);

  return (
    <div>
      <h1>Config Value: {configValue ? configValue : "Loading..."}</h1>
    </div>
  );
};

export default ConfigDisplay;
